-- ----------------------------
-- Procedure structure for spAddNewGuest
-- ----------------------------
DROP PROCEDURE IF EXISTS `spAddNewGuest`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spAddNewGuest`(SRoomID INT,
	sTimeIn DateTime, SDuration INT,
	SAmount DOUBLE)
BEGIN
	INSERT INTO guests(roomId,duration,timeIn,timeOut,amount) 
	VALUES(SRoomID,SDuration,sTimeIn,DATE_ADD(NOW(), INTERVAL SDuration HOUR),SAmount);
	UPDATE rooms SET rooms.`status` = 1 WHERE rooms.roomId = SRoomID;
END
;;
DELIMITER ;

