-- ----------------------------
-- Procedure structure for spGetGuestUsingDetails
-- ----------------------------
DROP PROCEDURE IF EXISTS `spGetGuestUsingDetails`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetGuestUsingDetails`()
BEGIN
	SELECT guests.guestId, guests.roomId, guests.duration, guests.timeIn, guests.timeOut, guests.amount, TIMEDIFF(guests.timeOut,NOW()) AS LEFTTIME FROM guests;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for spUpdateGuestRoom
-- ----------------------------
DROP PROCEDURE IF EXISTS `spUpdateGuestRoom`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateGuestRoom`(roomID INT)
BEGIN
		UPDATE rooms SET rooms.`status` = 0 WHERE rooms.roomId = roomID;
		UPDATE guests SET guests.`status` = 0 WHERE guests.roomId = roomID AND guests.status = 1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for spUpdateRoomStatus
-- ----------------------------
DROP PROCEDURE IF EXISTS `spUpdateRoomStatus`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateRoomStatus`()
BEGIN
	
	UPDATE rooms SET rooms.status = 0
	WHERE rooms.status =(
			SELECT status FROM(
				SELECT rooms.status 
				FROM rooms INNER JOIN guests ON rooms.roomId = guests.roomId 
				WHERE rooms.`status` = 1 AND TIMEDIFF(guests.timeOut,NOW())<0
				)s);
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for spUpdateSinger
-- ----------------------------
DROP PROCEDURE IF EXISTS `spUpdateSinger`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spUpdateSinger`(
	singerId INT,
	singerName VARCHAR(100),
	gender VARCHAR(1),	
	photo	MEDIUMBLOB
)
BEGIN
	UPDATE singers
	SET singerName = singerName, gender = gender, photo = photo
	WHERE singerID = singerId;
END
;;
DELIMITER ;
